import React, { useEffect } from "react";
import "owl.carousel/dist/assets/owl.carousel.css";
import "owl.carousel/dist/assets/owl.theme.default.css";
import $ from "jquery";
import "owl.carousel";

function Products() {
  useEffect(() => {
    $(".product-carousel").owlCarousel({
      loop: true,
      margin: 10,
      nav: true,
      responsive: {
        0: { items: 1 },
        600: { items: 2 },
        1000: { items: 4 }
      }
    });
  }, []);

  const products = [
    { img: "/img/product-1.png", name: "Organic Vegetable", price: "$19.00" },
    { img: "/img/product-2.png", name: "Organic Vegetable", price: "$19.00" },
    { img: "/img/product-1.png", name: "Organic Vegetable", price: "$19.00" },
    { img: "/img/product-2.png", name: "Organic Vegetable", price: "$19.00" },
    { img: "/img/product-1.png", name: "Organic Vegetable", price: "$19.00" }
  ];

  return (
    <div className="container-fluid py-5">
      <div className="container">
        <div className="mx-auto text-center mb-5" style={{ maxWidth: "500px" }}>
          <h6 className="text-primary text-uppercase">Products</h6>
          <h1 className="display-5">Our Fresh & Organic Products</h1>
        </div>
        <div className="owl-carousel product-carousel px-5">
          {products.map((product, index) => (
            <div className="pb-5" key={index}>
              <div className="product-item position-relative bg-white d-flex flex-column text-center">
                <img className="img-fluid mb-4" src={product.img} alt={product.name} />
                <h6 className="mb-3">{product.name}</h6>
                <h5 className="text-primary mb-0">{product.price}</h5>
                <div className="btn-action d-flex justify-content-center">
                  <a className="btn bg-primary py-2 px-3" href=" "><i className="bi bi-cart text-white"></i></a>
                  <a className="btn bg-secondary py-2 px-3" href=" "><i className="bi bi-eye text-white"></i></a>
                </div>
              </div> 
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default Products;
